window.bookSummaryJSON = "<p><b>Power has a price.</b></p> <p>Tim wants to find a place in his new world. He wants friends, but bringing them along puts them in harm’s way.</p> <p>He will have to learn to control his ever changing classes to gain the power he needs. But learning about who he truly faces makes it clear the deck is stacked against him. He must ask what he is willing to pay for the power to face it.</p> <p>But some evils just have to be killed at any price.</p> <p>Will he be able to live with the price once it has been paid?</p> <p>Book 2 in the next LitRPG saga from the Amazon Bestselling author of Life in Exile, Sean Oswald. It’s perfect for fans of Dakota Krout, Luke Chmilenko, and Troy Osgood.</p>"; 
